import React from 'react';
import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';
import Logo from '../Media/proximo.png';


const Landing = () => {
    return (
        <MDBContainer className="bg-primary mt-5">
            <div className="row">
                <div className="col">
                    hi
                </div>
                <div className="col">
                    <div className="text-end">
                        <img src={Logo} width="28" alt=""/>
                        
                    </div>
                </div>
            </div>
        </MDBContainer>
    );
}

export {Landing};
